utils:
function countryHeaderValueGetter(params) {
    switch (params.location) {
    case 'csv':
        return 'CSV Country';
    case 'clipboard':
        return 'CLIP Country';
    case 'toolPanel':
        return 'TP Country';
    case 'columnDrop':
        return 'CD Country';
    case 'header':
        return 'H Country';
    default:
        return 'Should never happen!';
    }
}
